    id integer NOT NULL,
    code character(6) NOT NULL,
    name longname NOT NULL,
    offeredby integer,
    stype integer,
    description textstring,
    firstoffer integer,
    lastoffer integer
);


--
-- Name: student_groups; Type: TABLE; Schema: public; Owner: -; Tablespace: 
--

CREATE TABLE student_groups (
    id integer NOT NULL,
    name longname NOT NULL,
    definition textstring NOT NULL
);


--
-- Name: students; Type: TABLE; Schema: public; Owner: -; Tablespace: 
--

CREATE TABLE students (
    id integer NOT NULL,
    stype character varying(5),
    CONSTRAINT students_stype_check CHECK (((stype)::text = ANY (ARRAY[('local'::character varying)::text, ('intl'::character varying)::text])))
);


--
-- Name: subject_group_members; Type: TABLE; Schema: public; Owner: -; Tablespace: 
--

CREATE TABLE subject_group_members (
    subject integer NOT NULL,
    ao_group integer NOT NULL
);


--
-- Name: subjects; Type: TABLE; Schema: public; Owner: -; Tablespace: 
--

CREATE TABLE subjects (
    id integer NOT NULL,
    code character(8) NOT NULL,
    name mediumname NOT NULL,
    longname longname,
    uoc integer,
    offeredby integer,
    eftsload double precision,
    career careertype,
    syllabus textstring,
    contacthpw double precision,
    _excluded text,
    excluded integer,
    _equivalent text,
    equivalent integer,
    _prereq text,
    prereq integer,
    replaces integer,
    firstoffer integer,
    lastoffer integer,
    CONSTRAINT subjects_uoc_check CHECK ((uoc >= 0))
);


--
-- Name: variations; Type: TABLE; Schema: public; Owner: -; Tablespace: 
--

CREATE TABLE variations (
    student integer NOT NULL,
    program integer NOT NULL,
    subject integer NOT NULL,
    vtype variationtype NOT NULL,
    intequiv integer,
    extequiv integer,
    yearpassed courseyeartype,
    mark integer,
    approver integer NOT NULL,
    approved date NOT NULL,
    CONSTRAINT twocases CHECK ((((intequiv IS NULL) AND (extequiv IS NOT NULL)) OR ((intequiv IS NOT NULL) AND (extequiv IS NULL)))),
    CONSTRAINT variations_mark_check CHECK ((mark > 0))
);


