1	Good	The University is not concerned about your progress.
2	Referral	The University is concerned about your progress.\nYour Program Office will assign an Academic Advisor to assist you in identifying and overcoming any problems that adversely impact on your ability to maintain acceptable progress toward completion of your Program.\nYou must consult your Academic Advisor to discuss your academic progress, plans for improving results, and future enrolment options.\n
3	Probation	The University is very concerned about your progress.\nYour Program Office will assign an Academic Advisor to assist you in identifying and overcoming any problems that adversely impact on your ability to maintain acceptable progress toward completion of your Program. \nUndergraduate students on PROBATION must consult their Academic Advisor to discuss their academic progress, plans for improving results, and future enrolment options.\nPostgraduate students on PROBATION must consult their Academic Advisor who may be able to assist with strategies to improve academic progress.\n
4	Prov.Suspension	(Semester 1 Only) The University is extremely concerned about your progress and believes that unless you address the issues that are impeding your academic progress, you will be suspended next semester.\nYour Program Office will assign an Academic Advisor to assist you in identifying and overcoming any problems that adversely impact on your ability to maintain acceptable progress toward completion of your Program.\nYou must consult your Academic Advisor to discuss your academic progress, plans for improving results, and future enrolment options.
5	Prov.Exclusion	(Semester 1 Only) The University is extremely concerned about your progress and believes that unless you address the issues that are impeding your academic progress, you will be excluded next semester. You have previously reached an Academic Standing level of SUSPENSION which is why your Academic Standing level is now Provisional Exclusion.\nYour Program Office will assign an Academic Advisor to assist you in identifying and overcoming any problems that adversely impact on your ability to maintain acceptable progress toward completion of your Program.\nYou must consult your Academic Advisor to discuss your academic progress, plans for improving results and future enrolment options.\n
6	Suspension	(Semester 2 Only) The University is extremely concerned about your progress and believes that a break in your studies is required in order to deal with the issues and problems that are impeding your academic progress.\nSUSPENSION means that you are not permitted to re-enrol for a period of one academic year but with automatic right of re-admission to the same program. If, however, after the period of suspension, you wish to undertake a Program other than the one you were enrolled in, you will have to re-apply for admission in the usual manner. 
7	Exclusion	(Semester 2 Only) The University has serious concerns about your ability to complete your Program.\nYou have previously reached an Academic Standing level of SUSPENSION which is why your Academic Standing level is now EXCLUSION.\nYou are excluded from the University for two academic years and you must re-apply for re-admission at the end of the exclusion period
8	Pending	Academic standing cannot be calculated due to late or withheld results. Your standing will be calculated as soon as your results are finalised.\nAcademic Standing is re-calculated on a regular basis, which means that shortly after your results are finalised, your Academic Standing will be adjusted accordingly.\nIf you still have unfinalised grades (WD, WC and LE) as at the date when Academic Standing is finalised (approximately 2 months after official release of results), these grades will be converted to NC (not completed) and be treated as failures when your academic standing is finalised for the semester.
